def table_exists(con, table_name):  # 这个函数用来判断表是否存在

    _sql = "show tables;"
    con.execute(_sql)

    tables = [con.fetchall()]

    table_list = re.findall('(\'.*?\')', str(tables))
    table_list = [re.sub("'", '', each) for each in table_list]

    if table_name in table_list:
        return 1  # 存在返回1
    else:
        return 0  # 不存在返回0


